            ‎‎‎‎‎‎‎‎‎‎‎Who is the Controller? What data are we processing and why? Who will process your data? How long do we keep your data for? What are your rights? Privacy Policy - General Regulations on Personal Data Protection - “Regulations" 1. Purpose of processing and consequences if you refuse to provide your personal data 2. Methods and Legal bases for processing 3. Disclosure of your personal data to third parties 4. Transfer of personal data outside the European Union 5. Maintaining of personal data 6. Data Controller and Data Protection Officer 7. Your rights  Welcome to our website www.armaniexchange.com (the Website). Your privacy and the security of your personal data are very important to "Giorgio Armani S.p.A.. That is why we are collecting and managing your personal data with the utmost attention and are adopting specific measures to keep it secure. Below you will find the main information about "Giorgio Armani S.p.A.'s processing of your personal data in relation to your navigation of www.armaniexchange.com and to the use of the services offered. For detailed information on how "Giorgio Armani S.p.A. manages your personal data, we ask that you carefully read this document and our ‎‎Privacy Policy‎‎. We also ask you that you read the ‎‎Cookie Policy‎‎General Terms of Use ‎‎ on the website www.armaniexchange.com, which contain detailed information about the terms of our services. Some services may be subject to specific legal terms, in which case we will give you all the appropriate information in each instance. Who is the Controller? The Website www.armaniexchange.com is managed by YOOX NET-A-PORTER GROUP S.p.A. company subject to the management and coordination of Compagnie Financière Richemont S.A., with registered office at via Morimondo, 17 – Milano 20143. ("YOOX NET-A-PORTER GROUP"), which acts as an independent processor of personal data for all sales-related activities, such as order registration and completion, the management of payments, any returns, and post-sales customer care services. "Giorgio Armani S.p.A., with registered office at Via Borgonuovo 11, 20121 Milano, Italy ("Giorgio Armani S.p.A.) acts as an independent data controller for the purposes of marketing, profiling and sharing your data, whenever you provide your consent to such processing. Below is the main information regarding how "Giorgio Armani S.p.A. processes your personal data. For any clarification, request or requirement related to your privacy and to the processing of your personal data, you may contact us at any time by sending a request to our ‎‎Customer Care‎‎ or by writing to the address of the registered office of "Giorgio Armani S.p.A.. If you wish to do so, you may also contact our Data Protection Officer (DPO), by writing to the aforementioned address, or via email to DPO@giorgioarmani.it. What data do we process and why?The personal data that YOOX NET-A-PORTER GROUP processes is the information that you provide when you complete an order and purchase items, and the information that we collect while you navigate or when you use the services offered on www.armaniexchange.com. YOOX NET-A-PORTER GROUP may thus collect data concerning you, for example, contact information such as first and last name, shipping address and billing address, data relating to payment, and navigation data. "Giorgio Armani S.p.A. processes, with your consent, the data that you provide to us when you wish to receive promotional information or communications from "Giorgio Armani S.p.A. or from other companies in the , such as first and last name, email address, date of birth, preferences (for example man or woman, interest in receiving communications about our apparel, accessories, or beauty products, etc.) "Giorgio Armani S.p.A. also processes data related to your purchases, when you provide your express consent to record your buying practices, preferences, and lifestyle so they can be used to create group and individual profiles ("profiling") which are used to send personalized communications, and to conduct market research and statistical research with anonymous data, organized in aggregate form. Your personal data is processed for the following purposes: to enter into and perform a contract to purchase items offered on www.armaniexchange.com;to provide you with the services of www.armaniexchange.com, such as registration for the newsletter;to allow you to register for the Website and use the services that are limited to registered users;to manage your requests sent to our ‎‎Customer Care‎‎. In the aforementioned cases, the processing of your personal data is lawful to the extent needed to perform a contract entered with you or to provide you with the service you have specifically requested. However, only with your express consent will we process your personal data for:carrying out sales communications activities;analyzing your purchase practices to create individual or group profiles;sharing your data with other companies in the ;personalizing the Website based on your interests. Who will process your data?Your personal data is processed by personnel who have been duly instructed by us and by other companies in the and, for organizational and functional requirements related to the provision of services on www.armaniexchange.com, by our providers. The latter have been evaluated and selected by "Giorgio Armani S.p.A. and by YOOX NET-A-PORTER GROUP for their proven expertise and reliability. Some of these parties may also be based in non-EU countries and, in these cases, the transfer of your personal data in these countries is carried out in compliance with the guarantees provided by law. For what period of time do we keep your data?We keep your personal data for a limited period of time, which depends on the purposes for which it was collected; after such period, your personal data will be deleted or nevertheless rendered irreversibly anonymous. The retention period is different depending on the purpose of the processing: for example, the data collected during the purchase of items on www.armaniexchange.com is processed until all of the administrative and accounting formalities have been completed, and is then archived in accordance with the local tax legislation (ten years), while the data used to send you our newsletter until you request that we stop sending it to you is nevertheless kept for a period of no more than 24 months. For further information see our ‎‎Privacy Policy‎‎. What are your rights?At any time, depending on the specific processing, you may: revoke your consent to processing, find out what personal data is in our possession, its source and how it is used, ask that the data be updated, corrected or supplemented as well as, in the cases provided for by the current provisions, have it deleted, limit its processing, or oppose it. If you wish, you may ask to receive the personal data in the possession of "Giorgio Armani S.p.A. in a form that can be read by electronic devices and, where technically feasible, we can transfer your data directly to a third party you have indicated. If you believe that the processing of your personal data has been carried out illegally, you can submit a claim to one of the supervisory authorities responsible for compliance with the rules on personal data protection. In Italy, you may submit a claim to the Personal Data Protection Authority [Garante per la Protezione dei Dati Personali] (http://www.garanteprivacy.it/). This information may be subject to changes and additions over time, so we ask that you periodically check the contents. Where possible, we will try to immediately inform you of any changes made. Privacy Policy- General Regulations on Personal Data Protection - "Regulations"  "Giorgio Armani S.p.A. (“Armani") as data controller informs you as follows regarding the processing of your personal data pursuant to Art. 13 of EU Regulation 2016/679 on personal data protection ("Regulations"). 1. Purposes of processing and consequences should you refuse to provide your personal data a) Purposes that require data processing to perform a requested service Armani processes the personal data you provide to allow you to use the services on the Website, which include requesting information about our products and their availability, requesting assistance, being recontacted, or reserving an appointment at a store. For such purposes, Armani processes your data such as title, first and last name, email address, data relating to your residence (city, country), and date of birth. For the purposes indicated above, providing your personal data is necessary and a refusal to do so will prevent you from using the requested service. b) Additional purposes: marketing - profiling - sharing of data with the With your consent (which is optional), Armani uses your personal data for marketing purposes, i.e. to send you promotional newsletters, sales, or advertising communications on events, promotional and sales initiatives of Armani, market research and satisfaction surveys, in addition to performing statistical analyses with anonymous data that has been organized in aggregate format. The marketing activities are completed by email, newsletter, telephone call via operator, sms, mms, chat, instant messaging, social networks and traditional mail, including the sending of invitations to events organized by Armani or in which Armani participates. You may at any time indicate the contact method you prefer of those noted above, or may oppose receiving promotional communications through all or just some of the aforementioned communication methods. With your consent (which is optional), Armani, at its own points of sale and online through websites or Armani accounts on social media, collects information relating to your preferences, practices, lifestyle, as well as the details for purchases made, in order to use it to create group and individual profiles ("profiling") which are used to send personalized communications and to perform market research and statistical research with anonymous data, which is organized in aggregate form. The personalized marketing activities are completed by email (newsletter), phone, sms, mms, chat, instant messaging, social network and traditional mail, including invitations to events. You may at any time indicate the contact method you prefer from among those noted above, and you may oppose receiving promotional communications through any or all of the communications methods listed above. With your consent (which is optional), Armani uses your personal data for the purposes of sharing it with the companies of the Armani group, in order to conduct marketing activities on their behalf, i.e. to send you promotional newsletters, sales or advertising communications about events, promotional and sales initiatives for companies in the Armani group, market research and satisfaction surveys, in addition to performing statistical analyses with anonymous data, organized in aggregate form. Marketing activities are carried out by email, newsletter, telephone calls through operators, sms, mms, chat, instant messaging, social networks, and traditional mail, including sending invitations to events organized by companies in the Armani group or in which the companies of the Armani group participate. You may indicate at any time the contact method you prefer from among those noted above and you may oppose receipt of the promotional communications through all or some of the communication channels noted above. For the marketing, profiling and data sharing activities Armani uses data such as your title, first and last name, email address, data relating to your place of residence (city, country), your date of birth, data relating to interactions with our digital initiatives (websites, social media), products viewed, requested and/or purchased, participation in events organized by Armani, or in which Armani participates. It is optional to provide your personal data for the aforementioned purposes of marketing, profiling and data sharing, and any refusal to do so shall have no effect on your registration with the website. 2. Methods and legal bases for the processingArmani processes your personal data with or without the aid of electronic instruments, based on logic and procedures that are consistent with the purposes indicated below and in accordance with the Regulations, including the confidentiality and security terms. You may provide the data when registering with the website www.armaniexchange.com, making purchases when visiting our boutiques, or when you interact with our digital initiatives (websites, social media), or during events that are organized by Armani or in which Armani participates. In accordance with the Regulations, the personal data concerning you that is acquired from you in each instance or from authorized third parties is used to update and correct the information that was previously collected. Armani processes your personal data based on the following criteria of legitimacy:Your consentArmani's legitimate interest in performing its activity;the performance of a specific request from you ;the fulfilment of legal obligations 3. Communication of your personal data to third partiesThe personal data is accessible to our duly authorized personnel based on criteria of need and is communicated to third parties in the following cases:  (i) when the communication is required by law and applicable regulations with respect to legitimate third parties who receive the data, such as public entities and authorities for the respective institutional purposes; (ii) communication to third parties in case of extraordinary operations (e.g. mergers, purchases, disposal of business, etc.) Your personal data is also shared with our service providers, e.g. for services of a technical and organizational nature which are functional for the purposes indicated above, such as independent associates, including partners, e.g. companies that manage our website, companies specialized in market research or data processing, advertising companies, etc. We provide these parties with the data needed to perform the services agreed to and they act as Data Processors, based on the instructions they receive from Armani. Armani does not disclose your data to third parties for them to be able to use it for their own marketing or profiling purposes. 4. Transfer of personal data outside the European UnionSome of the aforementioned parties may also be established outside the European Union, in countries that do not provide an adequate level of personal data protection according to the standards established by the Regulations. Armani takes the necessary precautions for data to be lawfully transferred (e.g. through implementation of the Standard Contractual Clauses approved by the European Commission). You may request information regarding the transfer abroad of your personal data at any time by contacting Armani or Armani's Data Protection Officer at the addressed indicated below. 5. Maintaining of personal dataThe personal data processed to respond to a specific request from you is kept for the time needed to perform the requested service. For the purposes of marketing, profiling and sharing data with companies of the the data is kept for the period of time that is strictly necessary to achieve the aforementioned purposes, within the limits granted by the Regulations. In particular, your data will be processed for a period of 12 months for profiling purposes and 24 months for marketing purposes. You may request that your data be deleted for such purposes and oppose the processing of data for marketing purposes at any time. 6. Data Controller and Data Protection Officer The Data Controller is Giorgio Armani S.p.A., with registered office at Via Borgonuovo 11, 20121 Milano, Italy. The Data Protection Officer is domiciled at the registered office of the Controller and may be contacted at the following email address: dpo@giorgioarmani.it. 7. Your rightsYou may contact Armani in its capacity as Data Controller or the Data Protection Officer at the addresses indicated above for an updated list of our data processors (i.e. our service providers), the parties to whom the data is disclosed and to exercise your rights per Art. 15 et seq. of the Regulations at any time; to obtain confirmation of whether or not your data exists, to check its content, source, accuracy, to request that it be supplemented, updated, corrected, deleted, anonymized, to request that it be transferred, that processing be limited, to oppose processing for legitimate reasons, e.g. opposing marketing activities, or to submit a claim to the Supervisory Authority (the Personal Data Protection Authority).







